@VeraJourova @dreynders @ChristianWigand @EU_Justice Do you read online reviews before placing an order?
New rules prohibit submitting fake reviews or endorsements. 
Traders will have to ensure that reviews are genuine by, for example, only allowing consumers who made a purchase to write a review. #ConsumerProtection https://t.co/nmgoarE99K

@VeraJourova @dreynders @ChristianWigand @EU_Justice Platforms will have to inform users about the main criteria determining their ranking of the offers, such as price, distance or consumer rating.
They will also have to clearly state whether search results are based on payments received from the listed traders.
#ConsumerProtection https://t.co/rZjnZgO9ym

